import React, { Component } from 'react';
import './App.css';
import {Route, Link} from 'react-router-dom';
import NavBar from './components/navbar.jsx';
import Home from './components/pages/home.jsx';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Route exact path="/" component={Home} />
    </div>
  );
}



export default App;
